import React, { Component } from "react";
import 'navbar.css'
class navbar extends Component {
  state = {};
  render() {
    return (
      <nav>
        <ul>
          <li>
            <a href="#home">Home</a>
          </li>
          <li>
            <a href="#askmentor">Ask Mentor</a>
          </li>
        </ul>
      </nav>
    );
  }
}

export default navbar;
